import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import { Circle } from 'react-konva';
import Konva from 'konva';

class Snake extends Component{
  state = {
    length: 3,
    positionX: 3,
    positionY: 3,
    moves: ["down", "down"]
  };

  render(){
    var circle = new Konva.Circle({
      radius: 10,
      fill: 'yellow',
      stroke: 'black',
    })
    circle.setAbsolutePosition({
      x: this.state.positionX,
      y: this.state.positionY
    })
    return(
      <div><p>ASSSSSSSSSSSS</p>
      <Circle x={this.state.positionX} y={this.state.positionY} radius={100} fill={'black'} stroke={'black'}/>
      </div>
    );
  }


}

class App extends Component {
  render() {
    return (
      <div className="App">
      <p className="App-bg">
          <img src={logo} className="App-logo" alt="logo" />
          <Snake></Snake>
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
      </p>
      </div>
    );
  }
}

export default App;
